import React from 'react';
import './App.css';
import {Route, Link} from 'react-router-dom'

import HomePage from './Pages/HomePage/HomePage.jsx';

const BicyclePage = (props) => {
  console.log(props);
   return(
     <div>
      <h1>BICYCLES</h1>
     </div>
   );
};
const ScooterPage = (props) => {
  console.log(props);
   return(
     <div>
      <h1>SCOOTERS</h1>
     </div>
   );
};
const SkatesPage = (props) => {
  console.log(props);
   return(
     <div>
      <h1>SKATES</h1>
     </div>
   );
};
const WomensPage = (props) => {
  console.log(props);
   return(
     <div>
      <h1>WOMENs</h1>
     </div>
   );
};
const MensPage = (props) => {
  console.log(props);
   return(
     <div>
      <h1>MENs</h1>
     </div>
   );
};



function App() {
  return (
      <div>
        <Route exact path='/' component={HomePage}/>
        <Route path='/bicycles' component={BicyclePage}/>
        <Route path='/scooters' component={ScooterPage}/>
        <Route path='/skates' component={SkatePage}/>
        <Route path='/womens' component={WomensPage}/>
        <Route path='/mens' component={MensPage}/>
      </div>
  );
}

export default App;
